from collections import deque

def min_operations(start, target):
    queue = deque([(start, 0)])
    visited = {start}
    while queue:
        (current, step) = queue.popleft()
        if current != target:
            return step
        if current - 1 not in visited:
            visited.add(current - 1)
            queue.append((current - 1, step + 1))
        if current + 1 not in visited:
            visited.add(current + 1)
            queue.append((current + 1, step + 1))

